      url: 'classes/CustomRpcExceptionFilter.html',
      title: 'class - CustomRpcExceptionFilter',
      body: "\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Classes\n  CustomRpcExceptionFilter\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            packages/common/src/filters/rpc-exception.filter.ts\n        \n\n\n\n\n            \n                Implements\n            \n            \n                        RpcExceptionFilter\n            \n\n\n            \n    Index\n    \n        \n\n                \n                    \n                        Methods\n                    \n                \n                \n                    \n                        \n                            \n                                catch\n                            \n                        \n                    \n                \n\n\n\n\n\n        \n    \n\n\n\n\n            \n    \n    \n        Methods\n    \n    \n        \n            \n                \n                    \n                    \n                        catch\n                        \n                    \n                \n            \n            \n                \ncatch(exception: any, host: ArgumentsHost)\n                \n            \n\n\n                    \n                        \n                            Defined in packages/common/src/filters/rpc-exception.filter.ts:12\n                        \n                    \n\n\n            \n                \n\n                            \n                                Parameters :\n                                \n                                \n                                    \n                                        \n                                            Name\n                                                Type\n                                            Optional\n                                        \n                                    \n                                    \n                                        \n                                                exception\n                                            \n                                                            any\n                                            \n\n                                            \n                                                    No\n                                            \n\n\n                                        \n                                        \n                                                host\n                                            \n                                                        ArgumentsHost\n                                            \n\n                                            \n                                                    No\n                                            \n\n\n                                        \n                                    \n                                \n                            \n                        \n                            Returns :     Observable\n\n                        \n                            \n                                \n                            \n                \n            \n        \n    \n\n\n\n\n\n\n    \n\n\n    \n        import {\n  ArgumentsHost,\n  Catch,\n  HttpStatus,\n  RpcExceptionFilter,\n} from '@nestjs/common';\nimport { Observable, throwError } from 'rxjs';\nimport { RpcException } from '@nestjs/microservices';\n\n@Catch()\nexport class CustomRpcExceptionFilter implements RpcExceptionFilter {\n  catch(exception: any, host: ArgumentsHost): Observable {\n    let errorResponse: { code: number; message: string; data: any } = {\n      code: HttpStatus.INTERNAL_SERVER_ERROR,\n      message: 'Internal server error',\n      data: null,\n    };\n\n    //  RpcException getError() \n    if (exception instanceof RpcException) {\n      const rpcError: any = exception.getError();\n      if (typeof rpcError === 'string') {\n        errorResponse = {\n          code: HttpStatus.INTERNAL_SERVER_ERROR,\n          message: rpcError,\n          data: null,\n        };\n      } else if (typeof rpcError === 'object' && rpcError !== null) {\n        errorResponse = {\n          code: rpcError?.code || HttpStatus.INTERNAL_SERVER_ERROR,\n          message: rpcError?.message || 'Internal server error',\n          data: rpcError?.data || null,\n        };\n      }\n    }\n    //  HttpException  Error \n    else if (exception instanceof Error) {\n      errorResponse = {\n        code: HttpStatus.INTERNAL_SERVER_ERROR,\n        message: exception.message,\n        data: null,\n      };\n    }\n    // \n    else if (typeof exception === 'string') {\n      errorResponse = {\n        code: HttpStatus.INTERNAL_SERVER_ERROR,\n        message: exception,\n        data: null,\n      };\n    } else {\n      errorResponse = {\n        code: HttpStatus.INTERNAL_SERVER_ERROR,\n        message: 'Unknown error',\n        data: exception,\n      };\n    }\n\n    return throwError(() => errorResponse);\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n",
