      body: "\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Classes\n  DownloadFilesDto\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            packages/common/src/dto/file/download-file.dto.ts\n        \n\n\n\n\n\n\n            \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                        \n                            \n                                    \n                                    \n                                    \n                                    \n                                    \n                                    \n                                fileIds\n                            \n                        \n                    \n                \n\n\n\n\n\n\n        \n    \n\n\n\n            \n    \n    \n        Properties\n    \n    \n        \n            \n                \n                    \n                    \n                            \n                            \n                            \n                            \n                            \n                            \n                        fileIds\n                        \n                    \n                \n            \n                \n                    \n                        Type :     number[]\n\n                    \n                \n                \n                    \n                        Decorators : \n                        \n                        \n                            @IsNotEmpty({message: 'fileIds '})@IsArray({message: 'fileIds '})@ArrayMinSize(1, {message: 'fileIds '})@Transform( => , {toClassOnly: true})@IsInt({each: true})@ApiProperty({description: 'ID', example: undefined})\n                        \n                    \n                \n                    \n                        \n                                Defined in packages/common/src/dto/file/download-file.dto.ts:17\n                        \n                    \n\n\n        \n    \n\n\n\n\n\n\n\n\n    \n\n\n    \n        import { ArrayMinSize, IsArray, IsNotEmpty, IsInt } from 'class-validator';\nimport { Transform } from 'class-transformer';\nimport { ApiProperty } from '@nestjs/swagger';\n\nexport class DownloadFilesDto {\n  @IsNotEmpty({ message: 'fileIds ' })\n  @IsArray({ message: 'fileIds ' })\n  @ArrayMinSize(1, { message: 'fileIds ' })\n  @Transform(({ value }) => value.map((v: string) => Number(v)), {\n    toClassOnly: true,\n  })\n  @IsInt({ each: true })\n  @ApiProperty({\n    description: 'ID',\n    example: [1, 2, 3],\n  })\n  fileIds: number[];\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n",
